    false,nt"url": null,nt"notes": "This narrative report for Lostwood National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1963.
    The report begins by summarizing the weather conditions, water conditions, and wildfires
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments and collections
    and receipts. Resource management is outlined; topics include grazing and fur trapping.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, violations, and safety. Items of interest and N-R forms are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
